/* Add Code Here */


/* Starter Code */
button {
  border: none;
  border-radius: 4px;
  padding: 5px 10px;
  cursor: pointer;
}
input[type="text"] {
  width: 320px;
  padding: 10px;
  margin: 10px;
  border: 1px solid #ccc;
  border-radius: 4px;
}
.todoItem {
  border: 1px solid #ccc;
  border-radius: 4px;
  padding: 7px;
  margin: 3px;
}

#pageTitle {
  font-size: 25px;
  font-weight: bold;
}

#inputContainer {
  display: flex;
  justify-content: center;
  align-items: center;
}

#todoList {
  display: flex;
  flex-direction: column;
  align-items: center;
}

.todoItem {
  width: 350px; 
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.deleteBtn {
  background-color: red;}


.deleteBtn:hover {
  background-color: darkred;
}

